const FOLLOW = 'FOLLOW';
const UNFOLLOW = 'UNFOLLOW';
const SET_USERS = 'SET_USERS';


let initialState = {
    users: [
        {id: 1, photoUrl:'data:image/png;base64,', followed: true, fullName: 'Dmitriy', status: 'I am a boss', location: {city: 'Minsk', country: 'Belarus'}},
        {id: 2,photoUrl:'data:image/jpeg;base64,', followed: true, fullName: 'Igor', status: 'I am a cat', location: {city: 'Moscow', country: 'Belarus'}},
        {id: 3, photoUrl:'data:image/jpeg;base64,', followed: false, fullName: 'Slava', status: 'I am a dog', location: {city: 'Kiev', country: 'Belarus'}},
        {id: 4, photoUrl:'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQmu47Tzi-9snKDIgESxyXseGsGpnzPnssk5g&usqp=CAU', followed: false, fullName: 'Pasha', status: 'I am a developer', location: {city: 'Minsk', country: 'Belarus'}
        },

    ]
}

export const usersReducer = (state = initialState, action) => {
    switch (action.type) {
        case FOLLOW:
            return {
                ...state, users: state.users.map(u => {
                    if (u.id === action.userId) {
                        return {...u, followed: true}
                    }
                    return u;
                })
            }
        case UNFOLLOW:
            return {
                ...state, users: state.users.map(u => {
                    if (u.id === action.userId) {
                        return {...u, followed: false}
                    }
                    return u;
                })
            }
        case SET_USERS: {
            return {...state, users: [...state.users, ...action.users]}
        }

        default:
            return state;
    }

}

export const followAC = (userId) => ({type: FOLLOW, userId});
export const unfollowAC = (userId) => ({type: UNFOLLOW});
export const setUsersAC = (users) => ({type: SET_USERS, users});


export default usersReducer;